<template>
    <Draggable :defaultPosition="{ x: cardStyle('x'), y: cardStyle('y') }" handle=".rare-value-header" class="rare-value-component">
      <div class="rare-value-header">
        <span class="rare-value-title">Rare Value</span>
        <div class="box_cross" v-on:click="close"></div>
      </div>
      <div class="rare-value-tabs"></div>
      <div class="rare-value-list">
        <div class="rare-value-details">
          <div class="rare-value-left">
            <div class="rare-value-manage">
              <select class="rare-value-selector" v-model="selectedTab" @change="() => setTab(selectedTab)">
                <option v-for="cat of getTabs()" :key="cat.id" :value="cat.id">{{ cat.name }}</option>
              </select>
              <div class="rare-value-search">
                <i class="rare-value-icon"></i>
                <input type="text" placeholder="Search rare value..." v-model="search" />
              </div>
            </div>
            <div class="rare-value-content" v-if="getCurrentTab().id !== -3">
              <InventoryItem v-for="item in getTabItems(getCurrentTab().id)" :key="item.id" :item="item" @clickItem="clickItem" :active="selectedItem?.id === item.id" />
            </div>
            <div class="rare-value-content frontpage" v-else v-html="rarevalues.frontpage"></div>
          </div>
          <div class="rare-value-item-clicked">
            <div class="rare-value-item-clicked-preview">
              <div class="rare-value-item-clicked-image" v-if="selectedItem != null && (getCurrentTab().id < 0 || selectedItem.category === getCurrentTab().id)" :style="{ backgroundImage: 'url(' + getItemIcon(selectedItem.image) + ')' }">
              </div>
              <div class="rare-value-item-clicked-image" v-else></div>
            </div>
            <div v-if="selectedItem != null && (getCurrentTab().id < 0 || selectedItem.category === getCurrentTab().id)" class="rare-value-price">
              <div class="rare-value-item-name">{{ selectedItem.name }}</div>
              <div class="rare-value-cost-currency" v-if="selectedItem.cost.credits > 0">
                <div class="rare-value-extra">
                  <span class="rare-value-price-text">{{ selectedItem.cost.credits }}</span>
                </div>
                <img class="rare-value-price-icon" :src="getCurrencyIcon(-1)" alt="currency">
              </div>
              <div class="rare-value-cost-currency" v-if="selectedItem.cost.points > 0">
                <div class="rare-value-extra">
                  <span class="rare-value-price-text">{{ selectedItem.cost.points }}</span>
                </div>
                <img class="rare-value-price-icon" :src="getCurrencyIcon(selectedItem.cost.pointsType)" alt="currency">
              </div>
            </div>
          </div>
        </div>
      </div>
    </Draggable>
  </template>
    
    <script lang="ts">
    import Vue from 'vue';
    import Component from 'vue-class-component';
    import InventoryItem from './InventoryItem.vue';
    import { State } from 'vuex-class';
    import { RareValuesState } from '@/store/types';
    import  Rare  from '@/store/models/Rare';
    import RareCategory from '@/store/models/RareCategory';

    @Component({
        components: {
            InventoryItem,
        },
    })
    export default class RareValueComponent extends Vue {
        @State(state => state.rarevalues) rarevalues!: RareValuesState;
        selectedTab: number = -3;
        selectedItem: Rare | null = null;
        search: string = "";
        data(){
            return {
                selectedTab: -3,
                selectedItem: null,
            }
        }
        mounted() {
            this.selectedTab = -3;
        }
        getCurrencyIcon(currency: number): string {
             //@ts-ignore
            const currencyUrl = (ExternalConfig.currencies as string);
            if(currencyUrl == null) return '';
            return currencyUrl.replace('%currency%', currency.toString());
        }

        getItemIcon(code: string): string {
        //@ts-ignore
        const itemsUrl = (ExternalConfig.items as string);
        if(itemsUrl == null) return '';
        return itemsUrl.replace('%code%', this.rarevalues.errors.includes(code) ? 'default' : code);
        }

        cardStyle(type: "x" | "y"): number {
            const screenWidth = window.innerWidth;
            const screenHeight = window.innerHeight;
            return (type === "x" ? screenWidth - 700 : screenHeight - 530) / 2;
        }

        clickItem(item: Rare) {
            if(!item) return;
            this.selectedItem = item;
        }

        getSelectedTab(): RareCategory {
            const tab = this.rarevalues.categories.filter((tab) => tab.id === this.selectedTab)[0];
            if(tab) return tab;
            this.selectedTab = this.rarevalues.categories[0].id;
            return this.rarevalues.categories[0];
        }

        getTabs(): RareCategory[] {
            return this.rarevalues.categories.sort((a, b) => a.id - b.id);
        }

        getCurrentTab(): RareCategory {
            return this.rarevalues.categories.filter((tab) => tab.id === this.selectedTab)[0];
        }

        getTabItems(tabId: number): Rare[] {
            if(tabId === -1) {
                return this.rarevalues.rares.filter((item) => item.name.toLowerCase().includes(this.search.toLowerCase()));
            }
            if(tabId === -2) {
                return this.rarevalues.rares.filter((item) => this.rarevalues.owned.includes(item.id) && item.name.toLowerCase().includes(this.search.toLowerCase()));
            }

            return this.rarevalues.rares.filter((item) => item.category === tabId && item.name.toLowerCase().includes(this.search.toLowerCase()));
        }

        setTab(tab: number) {
            this.selectedTab = tab;
        }

        getTabSize(tabId: number): number {
            if(tabId === -1) {
                return this.rarevalues.rares.length;
            }
            if(tabId === -2) {
                return this.rarevalues.rares.filter((item) => this.rarevalues.owned.includes(item.id)).length;
            }

            return this.rarevalues.rares.filter((item) => item.category === tabId).length;
        }

        close() {
            this.$store.commit('rarevalues/setOpen', false);
        }
    }
    </script>
    
